const shakesGrid = document.getElementById('shakesGrid');

// Function to display shake recipes
function displayShakeRecipes(recipes) {
    shakesGrid.innerHTML = '';
    recipes.forEach(recipe => {
        const card = document.createElement('div');
        card.className = 'shake-card';
        card.innerHTML = `
            <img src="${recipe.image}" alt="${recipe.title}">
            <h2>${recipe.title}</h2>
            <p>${recipe.description}</p>
        `;
        shakesGrid.appendChild(card);
    });
}

// Initial display of all shake recipes
displayShakeRecipes(shakeRecipes);
